utes to compute sparse multi-view result.\", (time.time() - start_time) / 60)\n\n        &lt;/pre&gt;\n        "},"id":"1390","type":"Div"},{"attributes":{"overlay":{"id":"1463"}},"id":"1136","type":"BoxZoomTool"},{"attributes":{},"id":"1074","type":"DataRange1d"},{"attributes":{},"id":"1137","type":"ResetTool"},{"attributes":{"factors":["a","b"]},"id":"1151","type":"FactorRange"},{"attributes":{"dimensions":"width"},"id":"1138","type":"PanTool"},{"attributes":{},"id":"1426","type":"BasicTickFormatter"},{"attributes":{"below":[{"id":"1119"}],"center":[{"id":"1122"},{"id":"1126"}],"min_border_bottom":50,"name":"task_stream","renderers":[{"id":"1131"}],"sizing_mode":"stretch_both","title":{"id":"1111"},"toolbar":{"id":"1127"},"toolbar_location":"above","x_range":{"id":"1108"},"x_scale":{"id":"1115"},"y_range":{"id":"1109"},"y_scale":{"id":"1117"}},"id":"bk-task-stream-plot","subtype":"Figure","type":"Plot"},{"attributes":{"active_multi":null,"tools":[{"id":"1205"}]},"id":"1195","type":"Toolbar"},{"attributes":{},"id":"1048","type":"BasicTicker"},{"attributes":{},"id":"1486","type":"UnionRenderers"},{"attributes":{"active_multi":null,"tools":[{"id":"1090"},{"id":"1091"},{"id":"1092"},{"id":"1093"},{"id":"1105"}]},"id":"1095","type":"Toolbar"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1094","type":"BoxAnnotation"},{"attributes":{},"id":"1428","type":"AllLabels"},{"attributes":{"overlay":{"id":"1059"}},"id":"1056","type":"BoxZoomTool"},{"attributes":{},"id":"1487","type":"Selection"},{"attributes":{"fill_alpha":{"field":"alpha"},"fill_color":{"field":"color"},"height":{"value":0.4},"line_alpha":{"value":0.6},"line_color":{"field":"color"},"line_width":{"value":3},"width":{"field":"duration"},"x":{"field":"start"},"y":{"field":"y"}},"id":"1129","type":"Rect"
